import { useNavigate } from "react-router-dom";

const Home = () => {

    const navigate = useNavigate();
    
    const navigateHandler = () => {
        navigate('/product');
    }

    return(
        <main>
            <h1>Home Page</h1>
            <button></button>
        </main>
    );
}

export default Home;
